import React from 'react'

function Main() {
  function clickMe()
  {
      alert ('You clicked me!')
  }
  return (
    // A react-chart hyper-responsively and continuously fills the available
    // space of its parent element automatically
    <div>
        <div>
            <button onClick={clickMe}>
            Record Fuel
            </button>
        </div>
        <div>
        <button onClick={clickMe}>
            Record Mileage
            </button>
        </div>
        <div>
        <button onClick={clickMe}>
            View Results
            </button>
        </div>
    </div>
  )
}

export default Main;
